<!DOCTYPE html>
<html lang="en">
<head>
<meta charset="UTF-8">
<title>Hangman</title>
<style>
  body{font-family:Arial,Helvetica,sans-serif;background:#f0f4f7;color:#333;margin:0;padding:20px;text-align:center}
  #word{font-size:2rem;letter-spacing:3px;margin:20px}
  .letter{display:inline-block;width:30px;height:40px;border-bottom:4px solid #555;font-weight:bold;font-size:1.5rem;color:#555}
  #keyboard button{margin:5px;padding:10px 15px;background:#fff;border:2px solid #333;border-radius:4px;cursor:pointer;font-size:1rem}
  #keyboard button:hover{background:#e0e0e0}
  #status{font-size:1.2rem;margin-top:20px}
</style>
</head>
<body>
<h1>Hangman</h1>
<div id="word"></div>
<div id="keyboard"></div>
<div id="status"></div>

<script>
const words = ['javascript','hangman','developer','challenge','function'];
let word = words[Math.floor(Math.random()*words.length)].toUpperCase();
let guessed = new Set(); let wrong=0; const maxWrong=6;
const letters='ABCDEFGHIJKLMNOPQRSTUVWXYZ'.split('');
const wordDiv=document.getElementById('word');
const kbDiv=document.getElementById('keyboard');
const statusDiv=document.getElementById('status');

function renderWord(){
  wordDiv.innerHTML='';
  for(let c of word){
    wordDiv.appendChild(document.createTextNode(guessed.has(c)?c:'_'));
    wordDiv.appendChild(document.createTextNode(' '));
  }
}
function renderKeyboard(){
  kbDiv.innerHTML='';
  letters.forEach(l=>{
    const btn=document.createElement('button');
    btn.textContent=l;
    btn.disabled=guessed.has(l);
    btn.onclick=e=>handleGuess(e.target.textContent);
    kbDiv.appendChild(btn);
  });
}
function handleGuess(letter){
  guessed.add(letter);
  if(!word.includes(letter)) wrong++;
  update();
}
function update(){
  renderWord(); renderKeyboard();
  statusDiv.textContent=`Wrong guesses: ${wrong}/${maxWrong}`;
  if(wrong>=maxWrong) statusDiv.innerHTML+=' <strong>Game Over!</strong>';
  else if([...new Set(word)].every(l=>guessed.has(l))) statusDiv.innerHTML+=' <strong>You Win!</strong>';
}
update();
</script>
</body>
</html>
